import { Link } from "react-router-dom";

const Body = () => {
    return ( 
        <div>
            <div className="row">
                <div className="col">
                    <Link to="/treeontreegame">3x3</Link>
                </div>
                <div className="col"><button>4x4</button></div>
                <div className="col"><button>5x5</button></div>
            </div>
        </div>
     );
}

export default Body;
